        channel: "Ethan Owen",
        image: { Video4 }
      },
      {
        id: "",
        title: "Choose The Perfect Accommodations",
        channel: "Lydia Perez",
        image: { Video5 }
      },
      {
        id: "",
        title: "Cruising Destination Ideas",
        channel: "Timothy Austin",
        image: { Video6 }
      }
    ]
  };

  render() {
    return (
      <div>
        {this.state.commentContents.map(content => (
          <Comments
            Name={content.Name}
            Date={content.Date}
            Comment={content.Comment}
          />
        ))}
      </div>
    );
  }
}

export default VideoList;
